import React from "react";
import Navbar from "./components/Navbar"
import Featured from "./components/Featured"
import BestSellers from "./components/BestSellers"


export default function Home(){


    return (
        <div className="container">
            <Featured num={0}/>
            <BestSellers/>
            <Featured num={1}/>
            <Featured num={2}/>
            <BestSellers/>
            <Featured num={3}/>
        </div>
    )
}
